  return (

<div class={s.container}>

    <ColorChanger2 className={s.onlineIndicator}>
        <ColorChanger className={s.blink}></ColorChanger>
    </ColorChanger2>
   
    
  <h2 className={s.onlineText}>{text}</h2>
</div>


  )
}
